import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Startpage from "./components/Startpage";
import Camera from "./components/CameraComponents/Camera";
import DemoPlaylist from "./components/SpotifyComponents/DemoSonglist";
import DemoPlaylist2 from "./components/SpotifyComponents/Demo2Songlist";
import SpotifyPlayer from "react-spotify-web-playback";
import "./App.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route
            path="/"
            exact
            render={() => {
              return <Startpage />;
            }}
          />
          <Route
            path="/camera"
            render={() => {
              return <Camera />;
            }}
          />
          <Route
            path="/playlist"
            render={() => {
              return (
                <SpotifyPlayer
                  token="BQB9vBKb6wUoPHKOKUqDdZZiSykBdjWkisTeXQFDZWlo8N_rBTR6CEVDcmrSbvIC2SMQD20N1pM2cO-ILtJHvJtZneG5bTLjpAn9KTBFiZXrOatidrI7DJbNL0uN7Yw1Sd7GiVs5Iyth9RT-hQ13914TyKzueQinlqOyu4AzoIf30ranBWDJ5luR4lGViAYOisA2XAHg72bfVX4"
                  uris={["spotify:track:6kkwzB6hXLIONkEk9JciA6"]}
                />
              );
              <DemoPlaylist />;
            }}
          />
          <Route
            path="/playlist2"
            render={() => {
              return <DemoPlaylist2 />;
            }}
          />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
